import React, { Component } from 'react'
import Header from '../../Parts/Header/Header'
import Card from '../../General/Cards/Card'
import CategoriesJSON from '../../../Json/Categories'
import Simple_Footer from '../../Parts/Footer/Simple_Footer'

import './Gallery.css'

class Gallery extends Component {
  render() {
    const Categories= CategoriesJSON.map((jsonItem) =>
        <Card item={jsonItem}/>
    );
    return (
      <div className="bgProj">
        <Header/>
        <div id="content" class="container-fluid row mt-5 pt-3 justify-content-center">
          <h1 className="col-md-3 text-light"> "Luxury is in each detail "</h1>
          {Categories}
        </div>
        <Simple_Footer/>

      </div>
    );
  }
}

export default Gallery
